import React, { useState } from 'react';
import './App.css';

const DefaultPage = () => (
  <div className="default-page">
    <h1>기본 페이지입니다.<hr></hr>기본 페이지라고 말했습니다.</h1>
  </div>
);  

const SignUpPage = () => {
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [isPasswordMatch, setIsPasswordMatch] = useState(false);

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
    setIsPasswordMatch(e.target.value === confirmPassword);
  };

  const handleConfirmPasswordChange = (e) => {
    setConfirmPassword(e.target.value);
    setIsPasswordMatch(password === e.target.value);
  };

  return (
    <div className="form-container sign-up-container">
      <form>
        <h1>Create Account</h1>
        <div className="social-container">
          <button className="social"><i className="fab fa-facebook-f"></i></button>
          <button className="social"><i className="fab fa-google-plus-g"></i></button>
          <button className="social"><i className="fab fa-linkedin-in"></i></button>
        </div>
        <span>or use your email for registration</span>
        <div className="infield">
          <input type="text" placeholder="Name" />
          <label></label>
        </div>
        <div className="infield">
          <input type="email" placeholder="Email" name="email" />
          <label></label>
        </div>
        <div className="infield">
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={handlePasswordChange}
          />
          <label></label>
        </div>
        <div className="infield">
          <input
            type="password"
            placeholder="Confirm Password"
            value={confirmPassword}
            onChange={handleConfirmPasswordChange}
          />
          {isPasswordMatch && <span className="checkmark">✔️</span>}
          <label></label>
        </div>
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
};

const SignInPage = () => (
  <div className="form-container sign-in-container">
    <form>
      <h1>Sign in</h1>
      <div className="social-container">
        <button className="social"><i className="fab fa-facebook-f"></i></button>
        <button className="social"><i className="fab fa-google-plus-g"></i></button>
        <button className="social"><i className="fab fa-linkedin-in"></i></button>
      </div>
      <span>or use your account</span>
      <div className="infield">
        <input type="email" placeholder="Email" name="email" />
        <label></label>
      </div>
      <div className="infield">
        <input type="password" placeholder="Password" />
        <label></label>
      </div>
      <button type="submit" className="forgot">Forgot your password?</button>
      <button type="submit">Sign In</button>
    </form>
  </div>
);

function App() {
  return (
    <Router>
      <div className="container">
        <div className="header">
          <Link to="/" className="daemonset-logo">DaemonSet</Link>
        </div>
        <div className="nav-links">
          <Link to="/signin">Sign In</Link>
          <Link to="/signup">Sign Up</Link>
        </div>
        <Routes>
          <Route path="/" element={<DefaultPage />} />
          <Route path="/signin" element={<SignInPage />} />
          <Route path="/signup" element={<SignUpPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
